require 'csv'
require 'json'
require 'HTTParty'

module StocksHelper
  def stocks_runner
    if !Stock.find_by(id: 1)
      stocks_make_dict
      populate_data
      stocks_update_versus_index
    end
  end

  def populate_data
    url = 'http://finance.yahoo.com/d/quotes.csv?s='
    connect = "&f="
    eps = "e"
    pe = "r"
    peg = "r5"
    pbook = "p6"
    psales = "p5"
    markcap = "j1"
    ask = "a"
    bid = "b"
    book_value = "b4"

    Stock.all.each do |symbol|
      full_url = url + symbol.ticker + connect + eps + pe + pbook + psales + markcap + ask + bid + peg + book_value
      response = HTTParty.get(full_url)
      parsed = CSV.parse(response)[0]
      symbol.update_attributes(eps: parsed[0].to_f,
        pe: parsed[1].to_f,
        pbook: parsed[2].to_f,
        psales: parsed[3].to_f,
        markcap: parsed[4].to_f * 1000000000,
        ask: parsed[5].to_f,
        bid: parsed[6].to_f,
        peg: parsed[7].to_f,
        book_value: parsed[8].to_f * 1000000000
        )

      shares = symbol.markcap/((symbol.ask + symbol.bid)/2)

      if symbol.eps >= 0 && symbol.book_value >= 0 && shares >= 0
        gnum = Math.sqrt(22.5 * symbol.eps * (symbol.book_value/shares))
      else
        gnum = 0
      end
      symbol.update_attributes(graham_number: gnum, shares: shares)
    end

    Stock.where(graham_number: 0).destroy_all
    Stock.where(graham_number: nil).destroy_all
    Stock.where(eps: nil).destroy_all
    Stock.where(pe: nil).destroy_all
    Stock.where(pbook: nil).destroy_all
    Stock.where(markcap: nil).destroy_all
    Stock.where(peg: nil).destroy_all
    Stock.where(book_value: nil).destroy_all
    Stock.where(shares: nil).destroy_all
  end

  def stocks_update_versus_index
    Industry.where(graham_number: 0).destroy_all
    Industry.where(graham_number: nil).destroy_all
    Industry.where(eps: nil).destroy_all
    Industry.where(pe: nil).destroy_all
    Industry.where(pbook: nil).destroy_all
    Industry.where(markcap: nil).destroy_all
    Industry.where(peg: nil).destroy_all
    Industry.where(book_value: nil).destroy_all
    Industry.where(shares: nil).destroy_all

    Stock.all.each do |symbol|
      if !Industry.find_by(name: symbol.industry).nil?
        industry = Industry.find_by(name: symbol.industry)
        symbol.update_attributes(
          eps_v_ind: (symbol.eps - industry.eps),
          pe_v_ind: (symbol.pe - industry.pe),
          pbook_v_ind: (symbol.pbook - industry.pbook),
          psales_v_ind: (symbol.psales - industry.psales),
          markcap_v_ind: (symbol.markcap - industry.markcap),
          peg_v_ind: (symbol.peg - industry.peg),
          book_value_v_ind: (symbol.book_value - industry.book_value),
          shares_v_ind: (symbol.shares - industry.shares),
          graham_number_v_ind: (symbol.graham_number - industry.graham_number)
          )
      end
    end
  end

